import React from 'react';
import styled from 'styled-components';


const Instagram = () => {

    const Container = styled.div`
        grid-template-columns: 100px 50px 100px;
        grid-template-rows: 80px auto 80px; 
        column-gap: 10px;
        row-gap: 15px;
        justify-content: end;
    `
    const ItemOne = styled.div`

        grid-column-start: 1;
        grid-column-end: 9;
        grid-row-start: 1;
        grid-row-end: 6;

    `

    return (
        <Container>

            <div>
                <img src="../img/cater-gallery-img/wedding-bands-and-flowers.jpg" alt="wedding rings and flowers"/>
            </div>

            <div>
                <img src="../img/cater-gallery-img/wedding-couple-sign.jpg" alt="wedding couple sign"/>
            </div>

            <div class="image-item image-item-3">
                <img src="../img/cater-gallery-img/party-reception.jpg" alt="party toast"/>
            </div>

            <div class="image-item image-item-4">
                <img class="image-img" src="../img/cater-gallery-img/graduation-ceremony.jpg" alt="graduation ceremony"/>
            </div>

      </Container>
    )
}

export default Instagram;
